// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./Test2.sol";

contract Test {

    address test2Address;
    Test2 test2Params;

    constructor(address _test2Address) {
        test2Address = _test2Address;
        test2Params = new Test2();
    }
    // 실행할 함수 데이터를 저장할 변수
    // struct functionInfo {
    //     address contractAddress;
    //     string name;
    //     uint256[] args;
    // }

    // 스마트 계약으로 데이터를 전달하는 함수
    // function initialPlay(functionInfo[] memory functionInfos) public returns (functionInfo[] memory) {
    //     for (uint i = 0; i < functionInfos.length; i++) {
    //         // 각 객체에서 정보 추출
    //         address contractAddress = functionInfos[i].contractAddress;
    //         string memory functionName = functionInfos[i].name;
    //         uint256[] memory args = functionInfos[i].args;

    //         // 원하는 함수를 호출
    //         (bool success, ) = contractAddress.call(abi.encodeWithSignature(functionName, args));

    //         // 성공 여부 확인
    //         require(success, "Function call failed");
    //     }
    // }

    function initialPlay(bytes[] memory data) public {
        for (uint i = 0; i < data.length; i++) {
            // 데이터를 받고 해석
            address(this).call(data[i]);
            // (string memory functionName, bytes memory args, address contractAddress) = abi.decode(data[i], (string, bytes, address));
            // if (keccak256(abi.encodePacked(functionName)) == keccak256(abi.encodePacked("firstFunction"))) {
            // // 컨트랙트의 someFunction 함수 호출
            // test2Params(contractAddress).firstFunction(args);
        }
            // (bool success) = test2Params.functionName(args);
            // require(success, "Function call failed");

            // result를 원하는 데이터 유형으로 해석
            // 예: uint256 결과
            // uint256 uintResult = abi.decode(result, (uint256));
        //     return success;
        // }
    }

    // function test2PlayFirst(string memory str) public returns (uint256) {
    //     uint256 result = Test2(test2Address).firstFunction(str);
    //     return result;
    // }
    function test2PlayFirst(bytes memory parameters) public returns (uint256) {
        (string memory str, uint256 num) = abi.decode(parameters, (string, uint256));
        uint256 result = Test2(test2Address).firstFunction(str, num);
        return result;
    }

    function test2PlaySecond(uint256 num) public returns (uint256) {
        uint256 result = Test2(test2Address).secondFunction(num);
        return result;
    }
}

contracts/contract/Test2.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract Test2 {

    uint256 ffff = 0;
    uint256 ssss = 10;

    function firstFunction(string memory str, uint256 num) public returns (uint256) {
        return ffff++;
    }

    function secondFunction(uint256 num) public returns (uint256) {
        return ssss++;
    }

    function getFirstValue() public view returns (uint256) {
        return ffff;
    }

    function getSecondValue() public view returns(uint256) {
        return ssss;
    }
}

